import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from './Modules/Layout/Component/Navbar';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from './Modules/Layout/Component/Home';
import UserManager from './Modules/UserList/Component/UserManager';
import ProductList from './Modules/Products/Component/ProductList';
import CartList from './Modules/CartList/Component/CartList';

function App() {
  return (
    <>
      <div className="grid">
        <BrowserRouter>
        <Navbar/>
          <Routes>
            <Route path='/' element={<Home/>}/>
            <Route path='/users' element={<UserManager/>}/>
            <Route path='/users' element={<UserManager/>}/>
            <Route path='/products' element={<ProductList/>}/>
            <Route path='/cart' element={<CartList/>}/>
          </Routes>
        </BrowserRouter>

      </div>
    </>
  );
}

export default App;
